import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Card({ person, size }) {
  return (
  <img
   
    src={person.src}
    alt={person.name}
    width={size}
    height={size}
    borderRadius = {size * '50%'}
  />
);
}


ReactDOM.render(
  <div>
    <h1>My Contacts</h1>
    <Card 
     size={100}
     person={{name:'Beyonce', src:'https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg'}}
    />
    <Card 
     size={80}
     person={{name:'Beyonce', src:'https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg'}}
    />
    <Card 
     size={50}
     person={{name:'Beyonce', src:'https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg'}}
    />
    
  </div>,

  document.getElementById("root")
);
